import { BrandService } from "./brand.service";
import { ListService } from "../list.service";
import tableMixin from '@/mixins/table.mixin';
import { columns } from "./brand.config";
export default {
  name: 'TeamCourseBrand',
  mixins: [tableMixin],
  serviceInject: function serviceInject() {
    return {
      brandService: BrandService
    };
  },
  rxState: function rxState() {
    return {
      categoryList: this.brandService.categoryList$,
      auth: this.brandService.auth$,
      list: this.brandService.list$,
      page: this.brandService.page$,
      loading: this.brandService.loading$
    };
  },
  data: function data() {
    return {
      columns: columns
    };
  },
  methods: {
    onDeleteCourse: function onDeleteCourse(record) {
      var _this = this;

      this.brandService.deleteCourse(record.id).subscribe(function () {
        _this.$router.reload();
      });
    },
    addPersonalCourse: function addPersonalCourse() {
      this.$router.push({
        name: 'brand-product-course-team-add'
      });
    },
    onClickCourseInfo: function onClickCourseInfo(id) {
      this.$router.push({
        name: 'brand-product-course-team-info',
        query: {
          courseId: id
        }
      });
    },
    onClickEditCourseInfo: function onClickEditCourseInfo(id) {
      this.$router.push({
        name: 'brand-product-course-team-edit',
        query: {
          id: id
        }
      });
    }
  }
};
